import logo from './logo.svg';
// import './App.css';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import Home from './pages/Home';
import Blogs from './pages/Blogs';

function App1() {
  return (
    <div className="text-8xl text-center text-blue-400 bg-black">
      <h1>Hello World!</h1>
    </div>
  );
}

const App = () => {
  return (
    <Router>
      <div>
        <nav>
          <ul className='flex'>
            <li>
              <Link to="/" className="text-xl underline text-blue-400">Home</Link>
            </li>
            <li>
              <Link to="/about">About</Link>
            </li>
          </ul>
        </nav>

        <hr />
        <Routes>
        <Route exact path="/" component={Home} />
        <Route path="/blogs" component={Blogs} />
        </Routes>
      </div>
    </Router>
  );
};

export default App;
